import { ChevronsDown } from "lucide-react";

const Home = () => {
  return (
    <div style={{ backgroundColor: "#F7F7E8", overflowX: "hidden" }}>
      <Hero />

      <section id="desc">
        <></>
      </section>

      <section
        id="more-info"
        className="py-5"
        style={{ marginTop: "-80px", marginRight: "-80px" }}
      >
        <ZooAnimalsSection />
      </section>

      <Footer />
    </div>
  );
};

export default Home;
